10) welcome home by coheed &amp; cambria
🎶 you could've been all I wanted, but you weren't honest

while this is perhaps the most mainstream coheed song I could've picked, it was my intro to a WONDERFUL prog rock band that began my journey of self-healing through music ;v;

8) jumpstarted by jukebox the ghost
🎶 now as I make the long walk home, you got me feelin' like an overdose

jukebox the ghost slammed into me about 2 years ago but fuck if this isn't an amazing song. from beginning to end it's just so rich and beautiful and I adore it ;o;

5) overwhelmed by royal &amp; the serpent
🎶 words come over me, feels like I'm somebody else

there's just something good about the cadence of this that hooked me once I got far enough in. idk what it's called but the rhythm meshed with the driving refrain is a nice brainfeel :&gt;

